;function getCookie(name) {
    var dc = document.cookie;
    var prefix = name + "=";
    var begin = dc.indexOf("; " + prefix);
    var end = null;
    if (begin === -1) {
        begin = dc.indexOf(prefix);
        if (begin !== 0) {return null;}
    }
    else
    {
        begin += 2;
        end = document.cookie.indexOf(";", begin);
        if (end === -1) {
        end = dc.length;
        }
    }
    return encodeURIComponent(dc.substring(begin + prefix.length, end));
}
var loginCookie = null;
 $(document).ready(function(){
   loginCookie = getCookie("login");
   if (loginCookie === null) {
     $('li.dashboard').hide();
     $('li.login').show();
   } else {
     $('li.dashboard').show();
     $('li.login').hide();
   }
 });
